import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import 'bulma/css/bulma.min.css';

const ele = document.getElementById("root");

const root = ReactDOM.createRoot(ele);

root.render(
        <App name={'A'} age={21}/>
        );
